#!/usr/bin/perl
sub nextchar{ sysread STDIN, $currentchar, 1; }
sub readint {
  if (!defined $currentchar){
     nextchar();
  }
  my $o = 0;
  my $sign = 1;
  if ($currentchar eq '-') {
    $sign = -1;
    nextchar();
  }
  while ($currentchar =~ /\d/){
    $o = $o * 10 + $currentchar;
    nextchar();
  }
  return $o * $sign;
}sub readspaces {
  while ($currentchar eq ' ' || $currentchar eq "\r" || $currentchar eq "\n"){ nextchar() ; }
}
sub remainder {
    my ($a, $b) = @_;
    return 0 unless $b && $a;
    return $a - int($a / $b) * $b;
}

# lit un sudoku sur l'entrée standard 

sub read_sudoku{
  my $out_ = [];
  foreach my $i (0 .. 9 * 9 - 1) {
    my $k = readint();
    readspaces();
    $out_->[$i] = $k;
    }
  return $out_;
}

# affiche un sudoku 

sub print_sudoku{
  my($sudoku_) = @_;
  foreach my $y (0 .. 8) {
    foreach my $x (0 .. 8) {
      print($sudoku_->[$x + $y * 9], " ");
      if ((remainder($x, 3)) eq 2) {
        print(" ");
      }
      }
    print("\n");
    if ((remainder($y, 3)) eq 2) {
      print("\n");
    }
    }
  print("\n");
}

